import React from 'react';
import { motion } from 'framer-motion';
import { X, MapPin, Gauge, Clock, AlertTriangle, CheckCircle2, Minus } from 'lucide-react';

const SensorDetail = ({ sensor, onClose = () => {} }) => {
  if (!sensor) return null;

  const statusColors = {
    critical: { bg: 'bg-red-100', text: 'text-red-800', border: 'border-red-300', icon: AlertTriangle },
    warning: { bg: 'bg-amber-100', text: 'text-amber-800', border: 'border-amber-300', icon: AlertTriangle },
    normal: { bg: 'bg-green-100', text: 'text-green-800', border: 'border-green-300', icon: CheckCircle2 },
  };

  const currentStatus = statusColors[sensor.status] || statusColors.normal;
  const StatusIcon = currentStatus.icon;

  const formatLastUpdate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleString();
  };

  return (
    <motion.div
      className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
      onClick={onClose}
    >
      <motion.div
        className="bg-white rounded-3xl p-8 shadow-2xl max-w-lg w-full relative"
        initial={{ scale: 0.9, y: 50 }}
        animate={{ scale: 1, y: 0 }}
        exit={{ scale: 0.9, y: 50 }}
        transition={{ type: "spring", stiffness: 200, damping: 20 }}
        onClick={(e) => e.stopPropagation()} // Evita que el clic en el contenido cierre el modal
      >
        <button
          onClick={onClose}
          className="absolute top-4 right-4 p-2 rounded-full bg-gray-100 hover:bg-gray-200 transition-colors duration-200"
        >
          <X className="w-5 h-5 text-gray-600" />
        </button>

        <div className="flex items-center gap-4 mb-6">
          <div className={`p-3 rounded-full ${currentStatus.bg} border ${currentStatus.border}`}>
            <StatusIcon className={`w-8 h-8 ${currentStatus.text}`} />
          </div>
          <div>
            <h3 className="text-3xl font-bold text-gray-900">{sensor.name}</h3>
            <p className={`text-lg font-semibold ${currentStatus.text}`}>Estado: {sensor.status.toUpperCase()}</p>
          </div>
        </div>

        <div className="space-y-4 text-gray-700">
          <div className="flex items-center gap-3">
            <MapPin className="w-5 h-5 text-blue-500" />
            <p><span className="font-semibold">Región:</span> {sensor.region}</p>
          </div>
          <div className="flex items-center gap-3">
            <Gauge className="w-5 h-5 text-purple-500" />
            <p><span className="font-semibold">Nivel del Sensor:</span> {sensor.value}%</p>
          </div>
          <div className="flex items-center gap-3">
            <Clock className="w-5 h-5 text-green-500" />
            <p><span className="font-semibold">Última Actualización:</span> {formatLastUpdate(sensor.lastUpdate)}</p>
          </div>
          {sensor.status === 'critical' && (
            <motion.div
              className="bg-red-50 border border-red-300 text-red-800 p-4 rounded-xl flex items-center gap-3 mt-6"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.2 }}
            >
              <AlertTriangle className="w-6 h-6 flex-shrink-0" />
              <p className="font-semibold">¡Alerta Crítica! Requiere mantenimiento inmediato.</p>
            </motion.div>
          )}
          {sensor.status === 'warning' && (
            <motion.div
              className="bg-amber-50 border border-amber-300 text-amber-800 p-4 rounded-xl flex items-center gap-3 mt-6"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.2 }}
            >
              <AlertTriangle className="w-6 h-6 flex-shrink-0" />
              <p className="font-semibold">Nivel bajo. Considerar revisión pronto.</p>
            </motion.div>
          )}
        </div>
      </motion.div>
    </motion.div>
  );
};

export default SensorDetail;
